import React from 'react'
import { Layout, Header, Content, Footer } from 'antd';
import Navbar from './Navbar';

const App = () => { 
    return (
        <Layout style={{ minHeight: '100vh' }}>
        <Navbar/>
        <Layout className="site-layout">
          <Header className="site-layout-background" style={{ padding: 0 }} />
          <Content>
          <iframe width="100%" height="100%"
                        src="https://embed.windy.com/embed2.html?lat=39.259&lon=-119.858&detailLat=25.493&detailLon=-90.945&width=650&height=450&zoom=9&level=surface&overlay=wind&product=ecmwf&menu=&message=true&marker=true&calendar=now&pressure=&type=map&location=coordinates&detail=&metricWind=mph&metricTemp=%C2%B0F&radarRange=-1"
                        frameborder="0"></iframe>
          </Content>
          <Footer style={{ textAlign: 'center' }}>Cody Worsnop Â©2021</Footer>
        </Layout>
        </Layout>
    );
};

export default App
